// Returns true if hospitalized, false otherwise
function takeDamage(amt) {
    if (typeof amt !== "number") {
        console.warn(`Player.takeDamage() called without a numeric argument: ${amt}`);
        return;
    }

    this.hp -= amt;
    if (this.hp <= 0) {
        this.hospitalize();
        return true;
    } else {
        return false;
    }
}

